import React, {Component} from 'react';
import './Channel.css';

class Channel extends Component {
	state = {
		channels: this.props.channels
	}

	selectChannel = () =>{
		console.log('Hey');
	}

	render(){
		return(
			<li onClick={ () => selectChannel() }>{this.state.channels.name}
			</li>
		)
	}
}

export default Channel;
